//思路一，找儿子方法
//已知根机构的id是0


function findChilds(departnum){
    var childDeparts=[];
    departs.forEach(function (depart) {
        if (depart.parentnum==departnum){
            childDeparts.push(depart);
        }
    });
    return childDeparts;
};

//找到根机构
var departTree={};
departs.forEach(function (depart) {
    if (depart.departnum=='0'){
        departTree = depart;
    }
});

departTree.childs=findChilds('0');
//console.log(departTree);

//循环查找子子孙孙

function findMore(cdepart) {
    if (cdepart.childs){
        cdepart.childs.forEach(function(depart){
            depart.childs = findChilds(depart.departnum);
            findMore(depart);
        })
    }
}

findMore(departTree);
console.log(JSON.stringify(departTree,null, 2));